      <img src={logo} height alt="로고 이미지" id="logo"></img>
      <button onClick={() => setComp(Home)}>home</button>
      <button onClick={() => setComp(About)}>About</button>
      <button onClick={() => setComp(NotFound)}>Users</button>
      <input type="button" value="시 작 하 기" class="btn-submit" id="btn-start"></input>
    </div>
  );
}

export default App;
